import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import ResponsiveAppBar from "./components/ResponsiveAppBar";
import Home from "./routes/Home";


const router = createBrowserRouter([
  {
    path: "/",
    element: <ResponsiveAppBar />,
    errorElement: <h1>Page not found :(</h1>,
    children: [
      {
        element: <h1>BUNA<h1>BUNA</h1><h1>BUNA</h1><h1>BUNA</h1><h1>BUNA</h1><h1>BUNA</h1><h1>BUNA</h1></h1>,
        path: ''
      },
      {
        element: <h1>Flowers</h1>,
        path: 'Flowers'
      },
      {
        element: <h1>Bonsais</h1>,
        path: 'Bonsais'
      }
    ]
  },
]);

function App() {
  return (
    <RouterProvider router={router} />
  )
}

export default App;
